import React, { useState, useEffect } from "react";
import axios from "axios";

const Product = (props) => {
  const [product, setProduct] = useState([]);
  useEffect(() => {
    getProduct();
  }, []);

  const getProduct = () => {
    axios
      .get("products.json")
      .then((response) => {
        setProduct(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <div>
      <h1>{props.roduct.name}</h1>
    </div>
  );
};

export default Product;
